import { MapContainer, TileLayer, Marker, Popup,} from 'react-leaflet'
import { Icon } from "leaflet";
import React, { useState, useEffect } from 'react';
import InputBase from '@mui/material/InputBase';
import Divider from '@mui/material/Divider';
import IconButton from '@mui/material/IconButton';
import MenuIcon from '@mui/icons-material/Menu';
import SearchIcon from '@mui/icons-material/Search';
import Paper from '@mui/material/Paper';
import '../App.css'
import axios from 'axios';

const position = [51.505, -0.09]

export default function Map() {

const getAddress = () => {
    axios.get(`https://geo.ipify.org/api/v2/country,city?apiKey=at_qaQb5z18XlN0etMkmTmNwTJbQzBnz&ipAddress=8.8.8.8`)
    .then(res => {
      const persons = res.data;
      console.log(persons)
    })  
}

useEffect(() => {
  // Update the document title using the browser API
  document.title = `You clicked ${count} times`;
});






  return (
      <div className='mapDiv'>
    <Paper
    className='input'
    component="form"
    sx={{ p: '2px 4px', display: 'flex', alignItems: 'center', }}
  >
    <InputBase
      sx={{ ml: 1, flex: 1 }}
      placeholder="Search Google Maps"
      inputProps={{ 'aria-label': 'search google maps' }}
    />
    <IconButton type="submit" sx={{ p: '10px' }} aria-label="search" onSubmit={getAddress()}>
      <SearchIcon />
    </IconButton>
  </Paper>

  <Paper elevation={3} className='display-dashboard'>
  <text className='title2'>IP Address</text>
  <Divider  orientation="vertical" variant="middle" flexItem />
  <text className='title2'>Location</text>
  <Divider  orientation="vertical" variant="middle" flexItem />
  <text className='title2'>Timezone</text>
  <Divider  orientation="vertical" variant="middle" flexItem />
  <text className='title2'>ISP</text>
  </Paper>

    <MapContainer
    center={[45.4, -75.7]}
    zoom={13}
    scrollWheelZoom={false}
    className='leaflet-container'
    >
    <TileLayer
      attribution='&copy; <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a> contributors'
      url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
    />
    
{this.persons.map(person =>(
  <Marker position={person.location.lat}/>
))}
   
  </MapContainer>
  </div>
  );
}
